import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Dashboard() {
  const [userData, setUserData] = useState(null);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://127.0.0.1:5000/user/data');
        setUserData(response.data);
      } catch (error) {
        console.error('Error fetching user data:', error);
      } finally {
        setIsLoading(false);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="container">
      {isLoading ? (
        <p>Loading...</p>
      ) : userData ? (
        <div>
          <h2>Welcome: {userData.first_name} {userData.last_name}</h2>
          <a className="text-danger" href="/user/logout">Logout</a>
          <div className="d-flex justify-content-center">
            <h1><a href="/nominee/dashboard">Nominator Dashboard</a></h1>
          </div>
          <div className="d-flex justify-content-center">
            <h1><a href="/recommender/dashboard">Recommender Dashboard</a></h1>
          </div>
          <div className="d-flex justify-content-center">
            <h1><a href="/review/dashboard">Review Committee Dashboard</a></h1>
          </div>
        </div>
      ) : (
        <p>No user data available.</p>
      )}
    </div>
  );
}

export default Dashboard;
